import { useState } from "react";
import {
  HomeIcon,
  UserGroupIcon,
  WalletIcon,
  MegaphoneIcon,
  BellIcon,
  ClockIcon,
  ExclamationTriangleIcon,
  CalendarIcon,
} from "@heroicons/react/24/outline";

export default function AdminDashboard() {
  const [activeTab, setActiveTab] = useState("User Reports");

  const sidebarItems = [
    { name: "Dashboard", icon: <HomeIcon className="w-5 h-5" /> },
    { name: "User Reports", icon: <UserGroupIcon className="w-5 h-5" /> },
    { name: "Wallet Logs", icon: <WalletIcon className="w-5 h-5" /> },
    { name: "Post Announcement", icon: <MegaphoneIcon className="w-5 h-5" /> },
  ];

  const stats = [
    { title: "New Reports Today", value: 12, icon: <BellIcon className="w-5 h-5" /> },
    { title: "Active Users Online", value: "2,847", icon: <UsersIcon className="w-5 h-5" /> },
    { title: "Wallet Requests Pending", value: 34, icon: <ClockIcon className="w-5 h-5" /> },
    { title: "Flagged Messages", value: 8, icon: <ExclamationTriangleIcon className="w-5 h-5" /> },
    { title: "Services Listed This Week", value: 156, icon: <CalendarIcon className="w-5 h-5" /> },
  ];

  const tabs = ["User Reports", "Dispute Center", "Wallet Logs"];

  const reports = [
    {
      id: "#USR-001",
      name: "John Smith",
      type: "Inappropriate Content",
      submittedBy: "Maria Garcia",
      date: "Jan 15, 2025",
      status: "Pending",
    },
    {
      id: "#USR-002",
      name: "Alex Johnson",
      type: "Scam/Fraud",
      submittedBy: "Sarah Wilson",
      date: "Jan 14, 2025",
      status: "Resolved",
    },
  ];

  return (
    <div className="flex h-screen bg-gray-50">
      {/* Sidebar */}
      <div className="w-60 bg-white border-r p-4 space-y-4">
        <h1 className="font-semibold text-lg">Admin Dashboard</h1>
        <nav className="space-y-2">
          {sidebarItems.map((item) => (
            <button
              key={item.name}
              className="flex items-center space-x-2 w-full px-3 py-2 rounded-md text-left hover:bg-gray-100"
            >
              {item.icon}
              <span>{item.name}</span>
            </button>
          ))}
        </nav>
      </div>

      {/* Main Content */}
      <div className="flex-1 p-6 overflow-y-auto">
        {/* Header */}
        <div className="flex items-center justify-between mb-6">
          <h2 className="text-xl font-semibold">Dashboard Overview</h2>
          <div className="flex items-center space-x-3">
            <input
              type="text"
              placeholder="Search..."
              className="border rounded-md px-3 py-1 text-sm"
            />
            <div className="w-8 h-8 bg-gray-300 rounded-full"></div>
          </div>
        </div>

        {/* Stats */}
        <div className="grid grid-cols-5 gap-4 mb-6">
          {stats.map((stat) => (
            <div
              key={stat.title}
              className="bg-white p-4 rounded-lg shadow flex items-center justify-between"
            >
              <div>
                <p className="text-sm text-gray-500">{stat.title}</p>
                <p className="text-xl font-semibold">{stat.value}</p>
              </div>
              {stat.icon}
            </div>
          ))}
        </div>

        {/* Tabs and Content */}
        <div className="bg-white p-4 rounded-lg shadow">
          <div className="flex space-x-6 border-b mb-4">
            {tabs.map((tab) => (
              <button
                key={tab}
                onClick={() => setActiveTab(tab)}
                className={`pb-2 text-sm font-medium ${
                  activeTab === tab
                    ? "border-b-2 border-black text-black"
                    : "text-gray-500"
                }`}
              >
                {tab}
              </button>
            ))}
          </div>

          {/* Table */}
          {activeTab === "User Reports" && (
            <table className="w-full text-sm">
              <thead>
                <tr className="text-left border-b">
                  <th className="py-2">User ID</th>
                  <th>Name</th>
                  <th>Report Type</th>
                  <th>Submitted By</th>
                  <th>Date</th>
                  <th>Status</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {reports.map((r) => (
                  <tr key={r.id} className="border-b">
                    <td className="py-2">{r.id}</td>
                    <td>{r.name}</td>
                    <td>{r.type}</td>
                    <td>{r.submittedBy}</td>
                    <td>{r.date}</td>
                    <td>
                      <span
                        className={`px-2 py-1 rounded text-xs ${
                          r.status === "Pending"
                            ? "bg-yellow-100 text-yellow-700"
                            : "bg-green-100 text-green-700"
                        }`}
                      >
                        {r.status}
                      </span>
                    </td>
                    <td className="space-x-2">
                      <button className="text-sm text-blue-600">View</button>
                      <button className="text-sm text-red-600">Suspend</button>
                      <button className="text-sm text-green-600">Resolve</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      </div>
    </div>
  );
}
